import "./dashboard.css";
import Sidebar from "./sidebar";

function dashboard() {
  return (
    <div className="pl-24 pr-24">
      <div className="pb-20">
        <h1>Dashboard Administrador</h1>
      </div>
      <div className="grid grid-cols-3 mx-auto w-max gap-8 mt-4">
        <div className="sm_grid">1</div>
        <div className="sm_grid">2</div>
        <div className="sm_grid">3</div>
      </div>
      <div className="grid grid-cols-2 gap-8 mt-6">
        <div className="lg_grid">4</div>
        <div className="lg_grid">5</div>
      </div>
    </div>
  );
}

export default dashboard;
